import { Component } from "react";

export class Form extends Component {
 

  render() {
    return (
      <div className="form">
        <input
          onChange={this.handleChange}
          value={this.state.text}
          placeholder="Whats on your mind?"
          required
        />
        <button>Add</button>
      </div>
    );
  }
}
